import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/navBar";
import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Outlet,
  Link,
  BrowserRouter,
} from "react-router-dom";

export default function App() {
  return (
    <Router>
      <div style={{ marginTop: 20 }}>
        <NavBar>
          <Routes>
            <Route path="/" element={<Layout />}>
              <Route index element={<Home />} />
              <Route path="devices" element={<About />} />
              <Route path="areas" element={<Dashboard />} />
              <Route path="*" element={<NoMatch />} />
            </Route>
          </Routes>
        </NavBar>
        <main className="main-content" id="main-content">
          <div className="mdc-drawer-app-content mdc-top-app-bar--fixed-adjust">
            {/* An <Outlet> renders whatever child route is currently active,
          so you can think about this <Outlet> as a placeholder for
          the child routes we defined above. */}
          </div>
        </main>
      </div>
    </Router>
  );
}

function Layout() {
  return (
      <div>
        <NavBarItem to="/" name={"Home"} icon={"home"} />
        <NavBarItem to="/areas" name={"Areas"} icon={"room"} />
        <NavBarItem to="/devices" name={"Devices"} icon={"settings_ethernet"} />
        <Outlet />
      </div>
  );
}

